import './jogos.css'
import { Celula } from '../../models/bingo/celula';
import Select from 'react-select';
import Option from 'react-select';

function Jogos() {

  const options = [{
    value: '1',
    label: '2x2'
  }, {
    value: '2',
    label: '3x3'
  }, {
    value: '3',
    label: '4x4'
  }, {
    value: '4',
    label: '5x5'
  }, {
    value: '5',
    label: '6x6'
  },]


  return (
    <div className="jogos">
      <div id='bingo'>
        <Celula text={"cu"} />
      </div>
      <div className='lista'>
        <h1>Jogos de Medo</h1>
        <input></input>
        <div className="col-md-6">
          <Select
            theme={(theme) => ({
              
              ...theme,
              borderRadius: 10,
              colors: {
                ...theme.colors,
                text: '#3f4247',
                primary25: '#3f4247',
                primary: 'white',
                backgroundColor: 1,
              },
            })}
            options={options} className='select' ></Select>
        </div>
      </div>
    </div>
  );
}

export default Jogos;
